const images = [{
  id: 1,
  url: 'https://upload.wikimedia.org/wikipedia/commons/d/d4/University_of_Michigan_Law_School.jpg',
  alt: 'University of Michigan Law School on a Winter day.',
  description: 'The University of Michigan Law School (Michigan Law) is the law school of the University of Michigan, in Ann Arbor. Founded in 1859, the school offers Juris Doctor (JD), Master of Laws (LLM), and Doctor of Juridical Science (SJD) degree programs.'
}, {
  id: 2,
  url: 'https://upload.wikimedia.org/wikipedia/commons/1/15/University_of_Michigan_College_of_Pharmacy_exterior.JPG',
  alt: 'University of Michigan College of Pharmacy on a Fall day.',
  description: "Pharmacy was first taught at the University of Michigan in 1868 within the College of Literature, Science and the Arts. A School of Pharmacy, the nation's first school of pharmacy at a state university, was established on December 29, 1876, by Albert B. Prescott. As the first dean, Dr. Prescott introduced the concept of basic science education as a prerequisite to practical training for those pursuing a pharmacy degree."
}, {
  id: 3,
  url: 'https://upload.wikimedia.org/wikipedia/commons/3/32/Michigan_Union_at_Night%2C_University_of_Michigan_Campus%2C_Ann_Arbor%2C_Michigan.JPG',
  alt: 'Michigan Union at night in the winter.',
  description: 'The Michigan Union is a student union at the University of Michigan. It is located at the intersection of South State Street and South University Avenue in Ann Arbor, Michigan. The building was built in 1917 and is one of several unions at the University of Michigan.'
}, {
  id: 4,
  url: 'https://upload.wikimedia.org/wikipedia/commons/6/6a/University_of_Michigan_August_2013_036_%28North_Campus_Diag%29.jpg',
  alt: '"Diag" on the University of Michigan North Campus on a Summer day.',
  description: 'Space on the University of Michigan campus became inadequate to accommodate the post-war growth of the University. In anticipation of this growing need, the Regents had begun to acquire farmland property on the sloping hills lying just to the northeast of the Huron River. Although there were some early thoughts given to relocating the School of Education, Natural Resources, Music, and Fine Arts to the North Campus, the construction of the Phoenix Memorial Project soon re-purposed the site for engineering research. More specifically, the early plans for the North Campus included the Cooley Memorial Laboratory to house the electronics research associated with the Willow Run Laboratories, the Phoenix Memorial Laboratory, the Automotive Laboratory, and a storage library. The development of the rest of the campus would proceed as needs arose and funds were secured. Possible projects suggested for the long-range future included a fine arts center where teaching facilities in music, theater, television, architecture, and design could be concentrated; residence halls and multiple-housing units for both single and married students, and staff; and facilities for the study of natural resources.'
}, {
  id: 5,
  url: 'https://upload.wikimedia.org/wikipedia/commons/1/17/Umichlawquadrangle.jpg',
  alt: 'Law Quad at the University of Michigan on a Spring day.',
  description: 'The Law School was founded in 1859, and quickly rose to national prominence. By 1870, Michigan was the largest law school in the country.'
}]
