document.addEventListener('DOMContentLoaded', function () {
  const thumbnailsContainer = document.getElementById('thumbnails');
  const featuredImage = document.getElementById('featured');
  const currentDescription = document.getElementById('current_description');

  // Loop through the images array and create <img> elements
  images.forEach(image => {
    const imgElement = document.createElement('img');
    imgElement.src = image.url;
    imgElement.alt = image.alt;
    imgElement.id = `image-${image.id}`;
    imgElement.classList.add('thumbnail'); // Add a class for easier styling

    // Add click event listener to update the featured image and description
    imgElement.addEventListener('click', function() {
      featuredImage.src = image.url;
      featuredImage.alt = image.alt;
      currentDescription.textContent = image.description;
    });

    // Append the <img> element to the thumbnails container
    thumbnailsContainer.appendChild(imgElement);
  });

  // Optionally, set the initial featured image if needed
  if (images.length > 0) {
    const firstImage = images[0];
    featuredImage.src = firstImage.url;
    featuredImage.alt = firstImage.alt;
    currentDescription.textContent = firstImage.description;
  }
});

